export const UserContext = createContext();

const UserStore = (props) => {
    const users = {
        "qestrnSeq" : "6",
        "trgetSe" : "100209",
        "name": "na",
        "gender": "",
        "school": "",
        "grade": "",
        "email": "",
        "startDtm": 1550466291034,
        "answers": ""
}

    return (<UserContext.Provider value={users}>{props.children}</UserContext.Provider>
    );
};

export default UserStore;
